Privolny () is a rural locality (a selo) in Yurkovsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 2 streets.
Geography
Privolny is located 12&nbsp;km east of Tarumovka (the district's administrative centre) by road. Tarumovka is the nearest rural locality.
